import React from 'react';

function Contact() {
  return (
    <section id="contact" className="section">
      <h2>Contact</h2>
      <p>Feel free to contact me via email at <a href="mailto:your-email@example.com">your-email@example.com</a>, or connect with me on:</p>
      <ul>
        <li><a href="https://linkedin.com/in/your-profile" target="_blank">LinkedIn</a></li>
        <li><a href="https://twitter.com/your-profile" target="_blank">Twitter</a></li>
        <li><a href="https://github.com/your-profile" target="_blank">GitHub</a></li>
        {/* Add more social media profiles as needed */}
      </ul>
    </section>
  );
}

export default Contact;
